import React, { useState } from "react";
import { Pole } from "./models/gameType";
import "./main.css";
import Cell from "./Cell";

function Main() {
  const [pole, setPole] = useState<Pole>(null);
  const [pole2, setPole2] = useState<Pole>(null);
  function changePole(p: Pole) {
    switch (p) {
      case null:
        setPole("x");
        break;
      case "x":
        setPole("0");
        break;
      case "0":
        setPole(null);
        break;
    }
  }

  return (
    <center>
      <Cell />
    </center>
  );
}

export default Main;
